import React from 'react'
import { useDispatch } from 'react-redux'
import ChatList from './ChatList'
import Search from './Search'
import SideBarHeader from './SideBarHeader'
import { logout } from '../../store/user.action'
const chats = [
    {
        user:{_id: '622c7c42309e3fc3e9311c66',username:"ben123",phone:""},
        _id: 123,
        users: [{ _id: '622a0dad1ae4f6945578a865' }, { _id: '6229b9eae5b41d932bd08fe6' }],
        msgs: [{ from: '622a0dad1ae4f6945578a865', to: '6229b9eae5b41d932bd08fe6', txt: 'hello test' }]
    },
]


export default function SideBar() {
    const dispatch = useDispatch()
    const onLogout = () => {
        dispatch(logout())
    }
    return (
        <section className="side-bar flex column">
            <SideBarHeader />
            <Search />
            <ChatList chats={chats} />
            <button className="logout-btn" onClick={onLogout}>Logout</button>
        </section>
    )
}
